description:
Represents financial data as a series of elements representing the high, low, closing, and, optionally, opening values of a data series. The top and bottom of the vertical line in each element represent the high and low values for the datapoint. The right-facing tick mark represents the closing value, and the left tick mark represents the opening value, if one was specified.   <p>The <code>&lt;mx:HLOCSeries&gt;</code> tag inherits all the properties of its parent classes, and adds the following properties:</p>  <pre>
 &lt;mx:HLOCSeries
 <strong>Styles</strong>
 closeTickLength=&quot;<i>No default</i>&quot;
 closeTickStroke=&quot;<i>No default</i>&quot;
 openTickLength=&quot;<i>No default</i>&quot;
 openTickStroke=&quot;<i>No default</i>&quot;
 stroke=&quot;<i>No default</i>&quot;
 /&gt;
 </pre>
